CREATE TABLE `region` (
  `id` BIGINT(20) NOT NULL COMMENT 'ID',
  `parent_id` BIGINT(20) DEFAULT NULL COMMENT '父id',
  `short_name` VARCHAR(100) DEFAULT NULL COMMENT '简称',
  `name` VARCHAR(100) DEFAULT NULL COMMENT '名称',
  `merger_name` VARCHAR(100) DEFAULT NULL COMMENT '完整名称',
  `level` TINYINT(1) DEFAULT NULL COMMENT '级别省市区 1为省级，2为市级，3为区县级',
  `pre_pinyin` VARCHAR(50) DEFAULT NULL COMMENT '拼音的第一个字母',
  `simple_py` VARCHAR(50) DEFAULT NULL COMMENT '首字母',
  `pinyin` VARCHAR(50) DEFAULT NULL COMMENT '拼音',
  `code` VARCHAR(50) DEFAULT NULL COMMENT '长途区号',
  `zip_code` VARCHAR(50) DEFAULT NULL COMMENT '邮编',
  `lng` DECIMAL(10,6) DEFAULT NULL COMMENT '经度',
  `lat` DECIMAL(10,6) DEFAULT NULL COMMENT '纬度',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='地区信息表';
